import React from 'react';

function Klaytn() {
	return (
		<div className="page">
			<h1>Klaytn</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>Klaytn은 블록체인 플랫폼 UI/UX 디자인 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>블록체인 플랫폼 UI/UX</li>
					<li>웹3.0 인터페이스 디자인</li>
					<li>모바일 앱 디자인</li>
					<li>대시보드 및 차트 디자인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Figma, Adobe XD, React, Web3 Technologies</p>
			</div>
		</div>
	);
}

export default Klaytn;
